import * as React from "react";
import { styled, useTheme } from "@mui/material/styles";
import Paper from "@mui/material/Paper";
import Divider from "@mui/material/Divider";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import MainBanner from "./components/MainBanner";
import RecentPosts from "./components/RecentPosts";
import Link from "@mui/material/Link";
import Box from "@mui/material/Box";

export default function Home() {
  return (
    <>
      {/* <MainBanner /> */}

      <Box sx={{ maxWidth: "md", margin: "auto", paddingTop: "140px" }}>
        <Typography variant="h3">ENSURE YOUR MAINFRAME SECURITY </Typography>
        <Typography variant="h4">with zSIEM Monitoring Solution </Typography>
        <Box sx={{ mt: "10px" }}>
          <Typography variant="subtitle">
            THE ONLY SECURITY & COMPLIANCE PLATFORM DEVELOPED SPECIFICALLY FOR
            THE Z/OS OPERATING SYSTEM
          </Typography>
          <br />
          <br />
          <br />
          <Typography variant="subtitle">
            This is strictly my portfolio and creative playground. If you are
            interested in working together visit my organization's page for
            inquiries:
          </Typography>
        </Box>

        <Button
          href="https://www.gannaway.org/"
          target="blank"
          sx={{ m: "10px" }}
          variant="contained"
          size="large"
        >
          Let's get to work
        </Button>
      </Box>

      <RecentPosts />
    </>
  );
}
